define(['jquery', 'jspdf', 'blobBuilder', 'fileSaver'], function($, jspdf, jspdfai, bb, fs){

	pdfg = new Object();


	pdfg._init = function(){

		var $downloadContract = $('.download#contract'),
			$downloadTranslations = $ ('.download#translations');

		$downloadContract.on('click', function(){
			pdfg._generateSaveContract();
		})

		$downloadTranslations.on('click', function(){
			pdfg._generateSaveContract();
		})

	}

	pdfg._generateSaveContract = function(){

		var logo = fileReader._logo;
		console.log(logo);
		if (logo == undefined){
			logo = 'data:image/jpeg;base64,';
		}

		var contract = new jsPDF();

		var signature = 'data:image/jpeg;base64,';
		
		var string = 'WWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWW';

		contract.setTextColor(89,90,92);
		contract.setFontSize(8);

		// Clause title
		contract.setFontType('bold');
		contract.text(10, 44, 'Clause 1');

		// Clause Body

		var clauseText = contract.setFontType('normal')
									.setFontSize(8)
									.splitTextToSize(string, 141);


		contract.text(60, 44, clauseText);
		


		// contract.text(60, 48, 'Clause Clause Clause Clause Clause Clause Clause ');

		// contract.text(60, 58, 'Clause Clause Clause Clause Clause Clause Clause ');



		contract.setDrawColor(89,90,92);
		contract.line(10, 36, 200, 36);
		contract.addImage(logo, 'JPEG', 94, 5, 30, 30);
		contract.addImage(signature, 'JPEG', 175, 284, 30, 10);

		contract.save('test.pdf');
	}

	pdfg._generateSaveTranslations = function(){
		alert('generate n trans');
	}

	pdfg._stringFormatter = function(string){
		console.log(string.length);

	}

	return pdfg;
});
